export default class Login extends Component {
  render() {
    return (
      <Style>
        <h1>LOGIN</h1>
        <form action="">
          <input type="text" name="user" id="" />
          <input type="password" name="" id="" />
          <button type="submit"> ACCEDER </button>
        </form>
      </Style>
    );
  }
}
